INSERT INTO `swd_order_print_content` (`id`, `pid`, `cid`, `p_sort`, `content`, `status`) VALUES
(1, 1, 12, 0, '阿斯顿发但是风格', 1),
(2, 1, 12, 0, '阿德刮大风111222', 1),
(3, 2, 23, 0, '士大夫敢死队风格s的风格', 1),
(4, 2, 22, 0, '是豆腐干山豆根岁的法国岁的法国', 1),
(5, 1, 11, 0, '啊SDFASDF', 1),
(6, 3, 31, 0, '岁月如歌，爱意如初，结婚纪念日快乐！愿你们的爱情历久弥新，幸福永远相伴。', 1),
(7, 3, 31, 0, '结婚纪念日快乐！愿你们的爱情如初，岁月无法磨灭；愿你们的生活幸福美满，携手共度每一个美好瞬间。祝你们永结同心，白头偕老！', 1),
(8, 2, 22, 0, 'ASFAS		\r\n			ASDFASDF', 1),
(9, 1, 11, 0, 'ASDFASDF', 1),
(10, 3, 31, 0, '一路走来，风雨共度，感谢有你。结婚纪念日快乐，愿我们的爱情永远甜蜜如初，幸福满满！', 1),
(11, 2, 21, 0, 'ASDFASDFASDF', 0),
(12, 3, 32, 0, 'ASDFHJFG大师傅敢死队风格', 1),
(13, 3, 32, 0, '岁的法国岁的法国岁的法国', 1),
(14, 3, 32, 0, '士大夫敢死队风格阿斯蒂芬', 1),
(15, 3, 32, 0, '森岛帆高阿斯顿发斯蒂44芬柔柔速度符弱弱44', 1),
(16, 2, 23, 0, '大大大水电费待定', 1),
(17, 5, 52, 0, '开业大吉,生意兴隆', 1),
(18, 5, 52, 0, '开业大吉,财源广进', 1),
(19, 5, 52, 0, '开业大吉,爆款连连', 1),
(20, 5, 51, 0, '订货会圆满成功', 1),
(21, 5, 51, 0, '秋冬新品订货会圆满成功', 1),
(22, 3, 31, 0, '岁月如梭，爱意不减；风雨同舟，情深似海。祝我们的结婚纪念日快乐，愿未来的日子，我们携手共度，白首不离。', 1),
(23, 3, 31, 0, '岁月悠悠，情深似海，今日恰逢佳节，愿你们的爱情历久弥新，幸福永远相伴。结婚纪念日快乐！', 1),
(24, 3, 31, 0, '愿你们的爱如初见般热烈，岁月长流中情深意浓。结婚纪念日快乐，愿你们的爱情永葆青春，白首不相离。', 1),
(25, 3, 31, 0, '愿你们的爱情如初，岁月长流不改初心；生活虽有磕磕碰碰，但彼此始终相濡以沫。结婚纪念日快乐，愿你们的幸福永远甜蜜！', 1),
(26, 3, 31, 0, '岁月悠悠，爱意绵长，与你共度每一个春夏秋冬，是我此生最美的诗篇。愿我们的爱情历久弥新，白首不相离。祝结婚纪念日快乐！', 1);
